import React, { Fragment } from "react";

export function Matricula() {
  return (
    <Fragment>
      <div className="matricula">
        <section className="matricula-s1">
          <div className="header-sep" />
        </section>
        <section className="matricula-s2">
        </section>
      </div>
    </Fragment>
  );
}
